  true,\n\t\"url\": null,\n\t\"notes\": \"In administering Title 14 of the Code of
  Federal Regulations CFR Part 77, the prime objectives of the FAA are to promote
  air safety and the efficient use of the navigable airspace. To accomplish this mission,
  aeronautical studies are conducted based on information provided by proponents on
  an FAA Form 7460-1, Notice of Proposed Construction or Alteration. Advisory Circular
  70/7460-1K, Obstruction Marking and Lighting, describes the standards for marking
  and lighting structures such as buildings, chimneys, antenna towers, cooling towers,
  storage tanks, supporting structures of overhead wires, etc. This report lists cases
  that have been determined\",\n\t\"license_title\": \"Other License Specified\",\n\t\"extras\":
